import React from "react";
import { Wrap } from "../styles/Footer";

function Footer() {
  return (
    <Wrap>
      <div className="container">
        <FooterWrap>
          <Text>
            Not only do we not discriminate over age, race, gender , we actively
            celebrate and encourage diversity. We actively accept job
            applications from individuals from all corners of the globe and all
            walks of life so don`t be shy.
          </Text>
        </FooterWrap>
      </div>
    </Wrap>
  );
}

export default Footer;
